import { useReducer } from "react";
import styled from "styled-components";
import Nav from "../lib/blocks/nav";
import Reducer from "../lib/reducers";
import Observer from "../lib/interface/observer";

const Container = styled.div`
  height: 200vh;
`;

const initalState = {
  scrolled: false
};

function HomePage() {
  const [store, reducer] = useReducer(Reducer.HomePage, initalState);

  return (
    <Container>
      <Observer>
        <Nav show={store.scrolled} />
      </Observer>
    </Container>
  );
}

export default HomePage;
